import React, { useEffect, useState } from "react";
import { getProvider, getMyNFTs, getEthBalance } from "../contractUtils";

export default function Inventory({ user, search, setSearch }) {
  const [address, setAddress] = useState(null);
  const [cars, setCars] = useState([]);
  const [houses, setHouses] = useState([]);
  const [balance, setBalance] = useState("0");

  useEffect(() => {
    async function fetchData() {
      const provider = await getProvider();
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      setAddress(userAddress);
      const nfts = await getMyNFTs(userAddress);
      setCars(nfts.filter(nft => nft.itemType === "car"));
      setHouses(nfts.filter(nft => nft.itemType === "house"));
      if (
        userAddress &&
        typeof userAddress === "string" &&
        userAddress.startsWith("0x") &&
        userAddress.length === 42
      ) {
        setBalance(await getEthBalance(userAddress));
      }
    }
    fetchData();
  }, [user]);

  // Filtering, derived from search
  const s = (search || "").trim().toLowerCase();
  const filteredHouses = !s
    ? houses
    : houses.filter(
        nft =>
          nft.name.toLowerCase().includes(s) ||
          (nft.addr && nft.addr.toLowerCase().includes(s))
      );
  const filteredCars = !s
    ? cars
    : cars.filter(
        nft =>
          nft.name.toLowerCase().includes(s) ||
          (nft.vin && nft.vin.toLowerCase().includes(s))
      );

  return (
    <div className="bg">
      <div className="inventory-content">
        <h1>Your Properties</h1>
        <div className="inventory-desc">
          View your owned houses and cars below. Use the Transfer tab to send an item.
        </div>
        <div>
          <div className="section-title">Houses</div>
          <div className="card-grid">
            {filteredHouses.length === 0 && <span>No houses found.</span>}
            {filteredHouses.map((nft) => (
              <div key={nft.tokenId} className="asset-card">
                <div className="asset-type">üè†</div>
                <div className="asset-title">{nft.name}</div>
                <div className="asset-detail">Worth: ${nft.value}</div>
                <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
                <div className="asset-detail">Address: {nft.addr}</div>
                <div className="asset-id">NFT ID: {nft.tokenId}</div>
              </div>
            ))}
          </div>
        </div>
        <div className="section-title" style={{marginTop:32}}>Cars</div>
        <div className="card-grid">
          {filteredCars.length === 0 && <span>No cars found.</span>}
          {filteredCars.map((nft) => (
            <div key={nft.tokenId} className="asset-card">
              <div className="asset-type">üöó</div>
              <div className="asset-title">{nft.name}</div>
              <div className="asset-detail">Worth: ${nft.value}</div>
              <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
              <div className="asset-detail">VIN: {nft.vin}</div>
              <div className="asset-id">NFT ID: {nft.tokenId}</div>
            </div>
          ))}
        </div>
      </div>
      <style>{`
        .bg {
          min-height: 100vh;
          background: linear-gradient(120deg,#f8fafc 60%,#e0e7ff 100%);
        }
        .inventory-content {
          max-width: 1050px;
          margin: 0 auto;
          margin-top: 38px;
          padding: 0 18px 80px 18px;
        }
        h1 {
          font-size: 2.1rem;
          font-weight: 700;
          margin-bottom: 9px;
        }
        .inventory-desc {
          margin-bottom: 28px;
          color: #5a6078;
          font-size: 1.1rem;
        }
        .section-title {
          font-size: 1.3rem;
          font-weight: 700;
          color: #36326d;
          margin-bottom: 12px;
        }
        .card-grid {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(260px, 1fr));
          gap: 28px;
          margin-bottom: 36px;
        }
        .asset-card {
          background: #fff;
          border-radius: 18px;
          box-shadow: 0 2px 22px #6366f114;
          padding: 22px 24px 19px 24px;
          display: flex;
          flex-direction: column;
          align-items: flex-start;
          transition: box-shadow .15s;
          min-width: 235px;
        }
        .asset-card:hover {
          box-shadow: 0 8px 32px #5eead423;
        }
        .asset-type {
          font-size: 2.2rem;
          margin-bottom: 8px;
        }
        .asset-title {
          font-size: 1.14rem;
          font-weight: 700;
          color: #312e81;
          margin-bottom: 7px;
        }
        .asset-detail {
          color: #69718a;
          font-size: 1.01rem;
          margin-bottom: 3px;
        }
        .asset-id {
          font-size: 0.98rem;
          color: #b0b2c3;
          margin-top: 8px;
        }
      `}</style>
    </div>
  );
}
